function colorText(text, colorCode) {
  // ANSI color codes: 
  // 37 = white, 36 = cyan(‡∏ü‡πâ‡∏≤), 32 = green
  return `\u001b[${colorCode}m${text}\u001b[0m`;
}

const positionEmojis = {
  carry: 'üèπ',
  midlane: '‚öîÔ∏è',
  offlane: 'üõ°Ô∏è',
  support: 'üíâ',
  hard_support: 'üíâ'
};

// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡∏•‡∏ö‡∏Æ‡∏µ‡πÇ‡∏£‡πà‡∏ó‡∏µ‡πà‡∏ä‡∏∑‡πà‡∏≠‡∏ã‡πâ‡∏≥‡πÉ‡∏ô array ‡πÄ‡∏î‡∏µ‡∏¢‡∏ß‡∏Å‡∏±‡∏ô ‡πÇ‡∏î‡∏¢‡πÄ‡∏Å‡πá‡∏ö‡∏ï‡∏±‡∏ß‡πÅ‡∏£‡∏Å‡πÑ‡∏ß‡πâ
function deduplicateHeroes(heroes) {
  const seen = new Set();
  return heroes.filter(hero => {
    if (seen.has(hero.hero)) return false;
    seen.add(hero.hero);
    return true;
  });
}

// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡∏ó‡∏≥‡∏Ñ‡∏ß‡∏≤‡∏°‡∏™‡∏∞‡∏≠‡∏≤‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏• facet ‡πÅ‡∏•‡∏∞ effect
function cleanHeroData(heroes) {
  return heroes.map(hero => {
    let cleanedHero = { ...hero };

    // ‡πÅ‡∏¢‡∏Å facet ‡πÅ‡∏•‡∏∞ effect ‡∏ó‡∏µ‡πà‡∏≠‡∏≤‡∏à‡∏õ‡∏ô‡∏Å‡∏±‡∏ô
    if (cleanedHero.facet && cleanedHero.effect) {
      // ‡∏ñ‡πâ‡∏≤ effect ‡∏°‡∏µ‡πÅ‡∏Ñ‡πà‡∏ä‡∏∑‡πà‡∏≠ hero ‡∏´‡∏£‡∏∑‡∏≠‡∏Ñ‡∏≥‡∏™‡∏±‡πâ‡∏ô‡πÜ ‡πÉ‡∏´‡πâ‡∏•‡∏ö‡∏≠‡∏≠‡∏Å
      if (cleanedHero.effect.split(' ').length <= 2) {
        cleanedHero.effect = '';
      }
    }

    // ‡∏ñ‡πâ‡∏≤ facet ‡∏¢‡∏≤‡∏ß‡πÄ‡∏Å‡∏¥‡∏ô‡πÑ‡∏õ ‡∏≠‡∏≤‡∏à‡∏à‡∏∞‡∏°‡∏µ‡∏ó‡∏±‡πâ‡∏á facet ‡πÅ‡∏•‡∏∞ effect ‡∏£‡∏ß‡∏°‡∏Å‡∏±‡∏ô
    if (cleanedHero.facet && cleanedHero.facet.length > 200) {
      // ‡πÅ‡∏¢‡∏Å‡πÇ‡∏î‡∏¢‡∏´‡∏≤ pattern ‡∏ó‡∏µ‡πà‡πÄ‡∏õ‡πá‡∏ô effect
      const parts = cleanedHero.facet.split(/\.\s*(?=[A-Z])/);
      if (parts.length > 1) {
        cleanedHero.facet = parts[0] + '.';
        if (!cleanedHero.effect || cleanedHero.effect.trim() === '') {
          cleanedHero.effect = parts.slice(1).join('. ');
        }
      }
    }

    return cleanedHero;
  });
}

// ‡∏•‡∏ö‡∏Æ‡∏µ‡πÇ‡∏£‡πà‡∏ã‡πâ‡∏≥‡πÅ‡∏•‡∏∞‡∏ó‡∏≥‡∏Ñ‡∏ß‡∏≤‡∏°‡∏™‡∏∞‡∏≠‡∏≤‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÉ‡∏ô‡πÅ‡∏ï‡πà‡∏•‡∏∞‡∏ï‡∏≥‡πÅ‡∏´‡∏ô‡πà‡∏á
['carry', 'midlane', 'offlane', 'support', 'hard_support'].forEach(pos => {
  if (dataObj[pos] && Array.isArray(dataObj[pos])) {
    dataObj[pos] = cleanHeroData(dataObj[pos]);
    dataObj[pos] = deduplicateHeroes(dataObj[pos]);
  }
});

// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡πÅ‡∏õ‡∏•‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏• hero list ‡πÄ‡∏õ‡πá‡∏ô Markdown ‡∏ï‡∏≤‡∏°‡∏ï‡∏≥‡πÅ‡∏´‡∏ô‡πà‡∏á
function formatPosition(positionName, heroes) {
  const key = positionName.toLowerCase().replace(/ /g, '_');
  const emoji = positionEmojis[key] || '';

  if (!heroes || heroes.length === 0) return `${emoji} **${positionName}**\n\nNo data available.\n\n`;
  let md = `\n${emoji} **${positionName}**\n\n`;
